var CustomDropDown = (function() {
    function b(g, f, d) {
        g.text($(f).text()).removeClass("active");
        g.focus();
        d.hide();
        var h = $(f).attr("rel");
        g.prev(".select-hidden").val(h).trigger("change");
        $(f).closest(".select-options").find("li.selected").removeClass("selected");
        var c = $(f).parents(":eq(1)").find("label");
        if (h != "") {
            $(c).addClass("selected")
        } else {
            $(c).removeClass("selected")
        }
    }

    function a(d, g, f, c) {
        d.keypress(function(j) {
            var h = j.which;
            if ((h == 13) || (h == 32)) {
                CustomDropDown.customListItems(g, this, c);
                return false
            }
        });
        d.click(function(h) {
            h.stopPropagation();
            CustomDropDown.customListItems(g, this, c)
        });
        c.find("li").unbind("keydown");
        c.find("li:last-of-type").on("keydown", function(h) {
            if (h.which == 9) {
                if (c.is(":visible") == true) {
                    g.removeClass("active");
                    c.hide()
                }
            }
        })
    }
    return {
        init: function() {
            function c() {
                $(".form-field-customdropdownselector").find("select").each(function() {
                    var l = $(this),
                        f = $(this).children("option").length;
                    l.addClass("select-hidden");
                    l.wrap('<div class="select"></div>');
                    l.after('<div class="select-styled" tabindex="0"></div>');
                    var k = l.next("div.select-styled");
                    k.text(l.children("option").eq(0).text());
                    var g = $("<ul />", { "class": "select-options", role: "combobox" }).insertAfter(k);
                    for (var j = 0; j < f; j++) {
                        $("<li />", { text: l.children("option").eq(j).text(), rel: l.children("option").eq(j).val() }).appendTo(g)
                    }
                    var h = g.children("li");
                    h.each(function() {
                        $(this).attr("tabindex", 0).attr("role", "listbox")
                    });
                    k.keypress(function(o) {
                        var m = o.which;
                        if ((m == 13) || (m == 32)) {
                            k.click();
                            return false
                        }
                    });
                    k.click(function(o) {
                        o.stopPropagation();
                        $("div.select-styled.active").not(this).each(function() {
                            $(this).removeClass("active").next("ul.select-options").hide()
                        });
                        $(this).toggleClass("active").next("ul.select-options").toggle();
                        var m = $(this).parent().find("select option:selected").index();
                        var p = $(this).parent().find(".select-options li")[m];
                        $(p).addClass("selected")
                    });
                    CustomDropDown.customListItemEvents(h, k, this, g);
                    $(document).click(function() {
                        k.removeClass("active");
                        g.hide()
                    })
                });
                var d = $(".form-field-customdropdownselector");
                d.find(".select-styled").focus(function(f) {
                    if (!$(this).hasClass("dropdown-focus-mouse")) {
                        $(this).addClass("dropdown-focus")
                    }
                }).blur(function() {
                    $(this).removeClass("dropdown-focus");
                    $(this).removeClass("dropdown-focus-mouse")
                });
                d.find(".select-styled").on("mouseover click mouseenter", function() {
                    $(this).addClass("dropdown-focus-mouse")
                }).on("mouseleave", function() {
                    $(this).removeClass("dropdown-focus-mouse")
                })
            }
            c()
        },
        customListItems: b,
        customListItemEvents: a
    }
})();
